s = ""

import time


def foo(s : str):
    temp = ""
    temp1 = s[1:]
    for i in range(len(s)):
        collect = temp + temp1
        if collect == collect[::-1]:
            return True
        temp += s[i]
        temp1 = s[i+2:]
    return False

t1 = time.time()
print(foo(s))
t2 = time.time()
print(t2-t1)

